data.value:
Выбор готового набора из выпадающего списка.
В список входят:
- пользовательские наборы, которые Вы сохранили;
- настройки по умолчанию, если заданы в программе;
- а также до 9 последних наборов значений (история)

Текстовое поле предназначено для ввода названия для нового пользовательского набора
